import React, { useState } from 'react';
import Task from './Task'

const TaskList = (props) => {

  const taskComponents = props.tasks.map((task, i) => {
      return(
      <li key={i}>
        <Task title = {task.title} />
      </li>);
    });

  return (
    taskComponents
  );
};

export default TaskList;
